import React from 'react'

const ImageToggleOneMouseOver = ({primaryImage, secondaryImage}) => {
  return (
    <div>
      <img src={primaryImage} alt="" width='800px'/>
    </div>
  )
}

export default ImageToggleOneMouseOver;
